import React from 'react';
import Button from '../Button/Button';
import Post from '../Post/Post';
import styles from './Profile.module.css';
const Profile = (props) => {
  const post = [
    {
      imageGroup: 'https://memax.club/wp-content/uploads/2019/05/55-176.jpg',
      groupName: 'Group 3',
      dataPost: 'Data Post',
      description: 'Description',
      imagePost: 'https://memax.club/wp-content/uploads/2019/05/55-176.jpg',
      amountLike: 12,
      amountPost: 15,
      amountReposts: 8,
    },
    {
      imageGroup: 'https://memax.club/wp-content/uploads/2019/05/55-176.jpg',
      groupName: 'Group 2',
      dataPost: 'Data Post',
      description: 'Today',
      imagePost: 'https://memax.club/wp-content/uploads/2019/05/55-176.jpg',
      amountLike: 12,
      amountPost: 15,
      amountReposts: 8,
    },
    {
      imageGroup: 'https://memax.club/wp-content/uploads/2019/05/55-176.jpg',
      groupName: 'group 1',
      dataPost: 'Data Post',
      description: 'Description',
      imagePost: 'https://memax.club/wp-content/uploads/2019/05/55-176.jpg',
      amountLike: 12,
      amountPost: 15,
      amountReposts: 8,
    },
  ];
  return (
    <div>
      <Post
        imageGroup={element.imageGroup}
        groupName={element.groupName}
        dataPost={element.dataPost}
        description={element.description}
        imagePost={element.imagePost}
        amountLike={element.amountLike}
        amountPost={element.amountPost}
        amountReposts={element.amountReposts}
      />
    </div>
  );
};

export default Profile;
